CREATE PROCEDURE dbo.proc_transform_247
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_247
    SET payload = LEFT(payload, 1000) + N'|V4-247|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_247;
END
